@EU_Commission @EUCourtPress Europeans praise their national orders and Constitutions.
You're not democratically elected, you try to overrun our true will as Europeans and you disrespect our differences. This is not Prague 1968...
Stop playing like you are Soviet Union 2.0,and let national States do the job.

@EU_Commission @EUCourtPress You are not authorized by the Accession Treaties and the EU Treaty to have these competencies in general.
Stick to those documents because they define what the EC is allowed to do and what not.
Not even nice try to extend your competencies on an illegal way.

@EU_Commission @EUCourtPress While liberals ruled Poland, the Constitutional Court issued the following judgement on November 16, 2011:

❝The Constitution of the Republic of Poland retains supremacy and primacy over all legal acts in force in the Polish constitutional order, including EU law❞

(1/2)
